import { Fragment } from "react";
import Card from "../UI/Card/Card";

const AddMeal = (props) => {
    
    const onSubmitHandler = (event) => {
        event.preventDefault();

        props.coseForm()

    }
    return(
        <Fragment>
            <form onSubmit={onSubmitHandler}>
            <Card>
                <input></input>
            </Card>


        </form>
        </Fragment>
    )
};
export default AddMeal
